widget.on('ready', function(){
$('g[class*=highcharts-axis-labels][class*=highcharts-xaxis-labels] text tspan').map(function(i, cell) { 
switch (cell.innerHTML ) {
case "-1": cell.innerHTML='Pre-K';
break;
case "0": cell.innerHTML='K';
break;
	default: cell.innerHTML = cell.innerHTML;
}
}) 
})

